import styled from 'styled-components';

const Sidebar = styled.div`
  background-color: 1b6ca8;
  grid-area: sidebar;
  border-bottom-left-radius: 8px;
  border-right: 1px solid ${(props) => props.theme.lightGrey};
  z-index: 5;
`;

export default Sidebar;
